var tipuesearch = {"pages": [{'title': '首頁', 'text': '小組成員: \n 40823204 repo / 40823204 site \n 40823205 repo / 40823205 site \n 40823220 repo / 40823220 site \n 40823221 repo / 40823221 site \n 40823228 repo / 40823228 site \n 40823237 repo / 40823237 site \n 40823242 repo / 40823242 site \n 40823250 repo / 40823250 site \n 40832244 repo / 40832244 site \n', 'tags': '', 'url': '首頁.html'}, {'title': 'stage3', 'text': '', 'tags': '', 'url': 'stage3.html'}, {'title': 'w12-13', 'text': '小組作品進度 \n 使用coppeliasim做初步模擬+lua控制 \n 說明:在場景中做初步的零件連接，並利用lua控制車子前進，但因為連接軸的問題，車子目前只能做前後移動和上下調整角度 \n \n', 'tags': '', 'url': 'w12-13.html'}, {'title': 'w14', 'text': '作品進度:將車子的連接方式改變，使其能夠轉彎 \n 因為原本車子輪胎是前後輪為一體的，為了不再修改圖面，使用coppeliasim內建功能toggle shape edit mode,把四個輪胎分開後並分別接上各個連接軸 \n 原先車子前後輪連接形式 \n \n 修改後之圖片 \n \n', 'tags': '', 'url': 'w14.html'}, {'title': 'w15', 'text': '作品進度:將程式用lua改為python remote api 控制 \n', 'tags': '', 'url': 'w15.html'}, {'title': '每周進度', 'text': '', 'tags': '', 'url': '每周進度.html'}, {'title': 'W10 新增Stage1、2 工作分配', 'text': '資料整理 \n \n', 'tags': '', 'url': 'W10 新增Stage1、2 工作分配.html'}, {'title': 'stage1', 'text': 'bg14 \n 專題主題: 升降平台 \n 組員/分工: \n 40823228/成品零件繪製、模擬、報告影片 \n 40823242/初稿零件繪製、模擬、報告影片 \n \n 主題簡述: \n 在工地裡，經常需要在高處實施作業，可是 目前在外面看到的作業平台都是用組裝式 的，不僅延長工作時間，在搭建過程，也有 極大的掉落風險，所以我們小組設計出”油 壓式升降平台”，不僅方便攜帶，也大幅減 少風險與搭建平台的作業時間。 \n --------------------------------------- \n bg24 \n 專題主題:升降裝置 \n 組員/分工: \n 40823204/CoppeliaSim 測試、分組網站、PDF 製 作、reveal 簡報 \n 40823220/繪圖(Inventor)、reveal 簡報  \n \n 主題簡述: \n 方便搬運重物：大型可用來載人、小型可用在各 種自動化機械。 \n --------------------------------------- \n bg16 \n 專題主題:氣動馬達 \n 組員/分工: \n 40823221/ Coppelia模擬、PDF製作、合併倉儲及網站 \n 40823237/ 繪製圖檔、reveal製作、倉儲推送及維護 \n \n 主題簡述: \n 因為對汽車作動原理有些許興趣，所以以引擎 的活塞與皮帶輪關係做變化。 \n --------------------------------------- \n bg17 \n 專題主題:挖土機 \n 組員/分工: \n 40832244/ Coppelia模擬、PDF製作、合併倉儲及網站 \n 40823250/ 繪製圖檔、reveal製作、倉儲推送及維護 \n \n 主題簡述: \n 對於重物的搬運相當耗時，幫助在有需要的工作上。 \n --------------------------------------- \n bg11 \n 專題主題:鋼板滑車 \n 組員/分工: \n 40823205/零件繪製及組裝、PDF製作 \n 40823239/倉儲推送及維護、reveal簡報 \n \n 主題簡述: \n 工業上需要提起重物的地方很多，這種時候使用鋼板滑車，能夠更加省力的舉起重物。 \n --------------------------------------- \n', 'tags': '', 'url': 'stage1.html'}, {'title': 'stage2', 'text': 'bg12 \n 專題主題: 自動門 開門機構 \n 組員/分工: \n 40823221/ 網頁編輯、程式模擬、PDF簡報製作 \n 40823237/ 繪製圖檔、程式模擬、Reveal製作 \n 40823250/ 繪製圖檔、網頁編輯 \n 40832244/ 網頁編輯 \n 主題簡述: \n 剛開始會想做項專題的原因是因為在去 年發生了全世界的病毒感染，所以我們 想過類似門或是其他需要人體接觸的地 方盡量能讓人不用用手碰觸。 後來會做此設計也有對接觸做設計，所 以我們將感應器裝在門的周圍，是他可 以自動開啟。 \n --------------------------------------- \n bg14 \n 專題主題: 省力搬運機 \n 組員/分工: \n 40823204/SolidWorks 零件繪製、模擬、報告影片 \n 40823205/Inventor 零件繪製、模擬、報告影片 \n 40823220/ Inventor 零件繪製、模擬、報告影片 \n 40832228/ PDF 製作、模擬、報告影片 \n 40823242/應力分析、模擬、報告影片 \n 主題簡述: \n 在工地裡,經常需要用到台車搬運東西,例如裝著水泥的箱子,如果是要靠人力搬運的話,不僅會造成工作效率的減少,也會使搬運人員的體力大量消耗,所以討論過後,我們小組決定設計”省力搬運機”,不僅解決搬運問題,也大幅地提高工作效率與人員體力的損耗。 \n', 'tags': '', 'url': 'stage2.html'}, {'title': 'W11 直播影片', 'text': 'stage3-bg5-40823220 40823250 主題:Task2、ipv4講解、作品的圖檔進度及講解和參考資料 20號:圖檔說明 50號:ipv4講解 \n 影片: \n 一. \n \n 二. \n \n', 'tags': '', 'url': 'W11 直播影片.html'}, {'title': 'W12 直播影片', 'text': 'stage3-bg5 40823205、40823228 主題 : 解決CMSIMDE版本錯誤 \n \n', 'tags': '', 'url': 'W12 直播影片.html'}, {'title': 'W13 機械手臂控制、程式控制攀爬機', 'text': '40823220網站 \n 本週主要為零件、產品大改良 \n 零件檔載點: 零件檔 \n 更進如下: \n 1.輪胎加大，紋路朝前，為了讓摩擦力增加 \n \n 2.將單向馬達架高，直接驅動蝸桿蝸輪，省略多餘的萬象接頭，使模擬更容易 \n \n 3.輪軸加大，使模擬安插軸更容易 \n 4.更改底板，因應前面所有改動，底板必須符合邏輯的變化 \n \n 修改完成使零件數目減少後，使攀爬機在CoppeliaSim中可以順利完成地形攀爬模擬。 \n 模擬影片: \n \n', 'tags': '', 'url': 'W13 機械手臂控制、程式控制攀爬機.html'}, {'title': 'W14-1', 'text': '', 'tags': '', 'url': 'W14-1.html'}, {'title': 'W15-1', 'text': '', 'tags': '', 'url': 'W15-1.html'}, {'title': '影片', 'text': 'ipv4連線操作影片 \n \n --------------------------------------- \n 直播的影片 \n \n \n \n ======= \n 4月29討論結果 主題:暫定 飛機或是汽車等之後再更改 \n \n', 'tags': '', 'url': '影片.html'}, {'title': 'W12', 'text': '1. stage3主題:無障礙越野車 \n 2.動機:想要一台可以克服各種障礙地形的車子 \n 3.繪圖者:40823220 \n 4.機構:利用萬向接頭帶動蝸桿蝸輪 \n 5.想法:前後輪用雙向馬達驅動，萬象接頭用單向馬達，材料採中空鋁件設計使整體更輕，上面設置供電器 \n \n \n \n \n ---------------------------------------------------------------------------------------------------- \n 上課直播 \n 40823221 40823237 主題: ipv4操作api \n \n \n 40823220 40823250 主題:Task2、ipv4講解、作品的圖檔進度及講解和參考資料 \n \n', 'tags': '', 'url': 'W12.html'}, {'title': 'W13', 'text': '本週主要為零件、產品大改良 \n 零件檔載點: 零件檔 \n 更進如下: \n 1.輪胎加大，紋路朝前，為了讓摩擦力增加 \n \n 2.將單向馬達架高，直接驅動蝸桿蝸輪，省略多餘的萬象接頭，使模擬更容易 \n \n 3.輪軸加大，使模擬安插軸更容易 \n 4.更改底板，因應前面所有改動，底板必須符合邏輯的變化 \n \n 5.將不動零件合併化，原本14件縮減到6件，使模擬大幅度容易 \n ---------------------------------------------------------------------------------------------------- \n 上課直播 \n 40823205 40823228 \n 主題:解決CMSIMDE版本錯誤 \n \n 40823220 40823250 \n 主題:介紹inventor及 reveal教學 \n \n', 'tags': '', 'url': 'W13.html'}, {'title': 'W14-2', 'text': '線上同步教學 \n 第一次直播 \n \n 第二次直播 \n \n', 'tags': '', 'url': 'W14-2.html'}, {'title': 'W15-2', 'text': '上課直播影片 \n \n', 'tags': '', 'url': 'W15-2.html'}, {'title': 'Task2', 'text': '', 'tags': '', 'url': 'Task2.html'}, {'title': 'Stage 1', 'text': 'stage1-bg14 \n \n import sim as vrep\nimport math\nimport random\nimport time\nimport keyboard\n   \nprint (\'Start\')\n   \n# Close eventual old connections\nvrep.simxFinish(-1)\n# Connect to V-REP remote server\nclientID = vrep.simxStart(\'127.0.0.1\', 19997, True, True, 5000, 5)\n  \nif clientID !=-1:\n    print (\'Connected to remote API server\')\n   \n    res = vrep.simxAddStatusbarMessage(\n        clientID, "40823242",\n        vrep.simx_opmode_oneshot)\n          \n    if res not in (vrep.simx_return_ok, vrep.simx_return_novalue_flag):\n        print("Could not add a message to the status bar.")\n          \n    opmode = vrep.simx_opmode_oneshot_wait\n    vrep.simxStartSimulation(clientID, opmode)\n    ret,vertical_handle=vrep.simxGetObjectHandle(clientID,"1",opmode)#設定軸對應名稱\n \n    while True:\n        #keyboard "w" 前進\n     if keyboard.is_pressed("w"):\n            print("up")\n            \n            vrep.simxSetJointTargetVelocity(clientID,vertical_handle,-0.01,opmode)\n     if keyboard.is_pressed("s"):#keyboard "s" 後退\n            print("down")\n            \n            vrep.simxSetJointTargetVelocity(clientID,vertical_handle,0.01,opmode)\n \n     if keyboard.is_pressed("q"):#keyboard "q" 前進後退停止\n            print("stop")\n            \n            vrep.simxSetJointTargetVelocity(clientID,vertical_handle,0,opmode)\n      \nelse:\n    print (\'Failed connecting to  remote API server\')\nprint (\'End\') \n \n stage1-bg16 \n \n stage1-bg24 \n \n import sim as vrep\nimport math\nimport random\nimport time\nimport keyboard\n  \nprint (\'Start\')\n  \n# Close eventual old connections\nvrep.simxFinish(-1)\n# Connect to V-REP remote server\nclientID = vrep.simxStart(\'192.168.50.217\', 19997, True, True, 5000, 5)\n   \nif clientID !=-1:\n    print (\'Connected to remote API server\')\n    \n    res = vrep.simxAddStatusbarMessage(\n        clientID, "40823204",\n        vrep.simx_opmode_oneshot)\n           \n    if res not in (vrep.simx_return_ok, vrep.simx_return_novalue_flag):\n        print("Could not add a message to the status bar.")\n           \n    opmode = vrep.simx_opmode_oneshot_wait\n    STREAMING = vrep.simx_opmode_streaming\n      \n    vrep.simxStartSimulation(clientID, opmode)\n     \n     \n    ret,joint0=vrep.simxGetObjectHandle(clientID,"joint0",opmode)\n    ret,joint1=vrep.simxGetObjectHandle(clientID,"joint1",opmode)\n    dy=0\n    dr=0\n    vrep.simxSetJointTargetPosition(clientID,joint0,dy,opmode)\n    vrep.simxSetJointTargetPosition(clientID,joint1,dr,opmode)\n     \n    while True:\n        #Clockwise\n        if keyboard.is_pressed("2"):\n            dy=dy-0.1\n            dr=dr+0.1\n            vrep.simxSetJointTargetPosition(clientID,joint0,dy,opmode)\n            vrep.simxSetJointTargetPosition(clientID,joint1,dr,opmode)\n            print("go")\n  \nelse:\n    print (\'Failed connecting to  remote API server\')\n    print (\'End\') \n \n \n', 'tags': '', 'url': 'Stage 1.html'}, {'title': 'Stage 2', 'text': 'stage2-bg12 \n \n \n stage2-bg14 \n \n import sim as vrep\nimport math\nimport random\nimport time\nimport keyboard\n  \nprint (\'Start\')\n  \n# Close eventual old connections\nvrep.simxFinish(-1)\n# Connect to V-REP remote server\nclientID = vrep.simxStart(\'192.168.50.217\', 19997, True, True, 5000, 5)\n   \nif clientID !=-1:\n    print (\'Connected to remote API server\')\n    \n    res = vrep.simxAddStatusbarMessage(\n        clientID, "40823204",\n        vrep.simx_opmode_oneshot)\n           \n    if res not in (vrep.simx_return_ok, vrep.simx_return_novalue_flag):\n        print("Could not add a message to the status bar.")\n           \n    opmode = vrep.simx_opmode_oneshot_wait\n    STREAMING = vrep.simx_opmode_streaming\n      \n    vrep.simxStartSimulation(clientID, opmode)\n     \n     \n    ret,fwheel_handle=vrep.simxGetObjectHandle(clientID,"joint0",opmode)\n    ret,bwheel_handle=vrep.simxGetObjectHandle(clientID,"joint2",opmode)\n    ret,pole1_handle=vrep.simxGetObjectHandle(clientID,"joint3",opmode)\n    ret,pole2_handle=vrep.simxGetObjectHandle(clientID,"joint4",opmode)\n    ds=0\n    dy=0\n    df=0\n    db=0\n    vrep.simxSetJointTargetPosition(clientID,fwheel_handle,df,opmode)\n    vrep.simxSetJointTargetPosition(clientID,bwheel_handle,db,opmode)\n    vrep.simxSetJointTargetPosition(clientID,pole1_handle,ds,opmode)\n    vrep.simxSetJointTargetPosition(clientID,pole2_handle,dy,opmode)\n     \n     \n    while True:\n        #Clockwise\n        if keyboard.is_pressed("2"):\n            ds=ds-0.01\n            dy=dy-0.01\n            vrep.simxSetJointTargetPosition(clientID,pole1_handle,ds,opmode)\n            vrep.simxSetJointTargetPosition(clientID,pole2_handle,dy,opmode)\n            print("up")\n        if keyboard.is_pressed("4"):\n            ds=ds+0.01\n            dy=dy+0.01\n            vrep.simxSetJointTargetPosition(clientID,pole1_handle,ds,opmode)\n            vrep.simxSetJointTargetPosition(clientID,pole2_handle,dy,opmode)\n            print("down")\n        if keyboard.is_pressed("6"):\n            df=df+0.2\n            db=db+0.2\n            vrep.simxSetJointTargetPosition(clientID,fwheel_handle,df,opmode)\n            vrep.simxSetJointTargetPosition(clientID,bwheel_handle,db,opmode)\n            print("left")\n        if keyboard.is_pressed("8"):\n            df=df-0.2\n            db=db-0.2\n            vrep.simxSetJointTargetPosition(clientID,fwheel_handle,df,opmode)\n            vrep.simxSetJointTargetPosition(clientID,bwheel_handle,db,opmode)\n            print("right")\n \n \n              \nelse:\n    print (\'Failed connecting to  remote API server\')\n    print (\'End\') \n \n', 'tags': '', 'url': 'Stage 2.html'}, {'title': 'Stage 3', 'text': '>>>>>>> e793fcf1540d71475a976f62fa71b3607719897f', 'tags': '', 'url': 'Stage 3.html'}]};